import React from 'react';
import { Box, Flex, Link, Heading } from '@chakra-ui/react';
import { Link as RouterLink } from 'react-router-dom';

function Navbar() {
  return (
    <Box bg="blue.500" px={4} py={3}>
      <Flex maxW="container.xl" mx="auto" align="center" justify="space-between">
        <Heading size="md" color="white">
          Habit Tracker
        </Heading>
        <Flex gap={6}>
          <Link as={RouterLink} to="/" color="white" _hover={{ textDecoration: 'none', color: 'blue.100' }}>
            Habits
          </Link>
          <Link as={RouterLink} to="/add" color="white" _hover={{ textDecoration: 'none', color: 'blue.100' }}>
            Add Habit
          </Link>
          <Link as={RouterLink} to="/stats" color="white" _hover={{ textDecoration: 'none', color: 'blue.100' }}>
            Statistics
          </Link>
        </Flex>
      </Flex>
    </Box>
  );
}

export default Navbar;
